If(
    IsBlank(TextInput1_10.Text) || IsBlank(TextInput1_11.Text),
    Notify("Username and password are required", NotificationType.Error),
    // Valid username and password provided
    Set(
        CurrentUser,
        LookUp(
            LoginDetails,
            UserName = TextInput1_10.Text && Password = TextInput1_11.Text
        )
    ),
    If(
        IsBlank(CurrentUser),
        Notify("Incorrect username or password", NotificationType.Error),
        Navigate(Screen2_1) // Assuming 'Screen2' is your target screen
    )
);

Reset(TextInput1_10);
Reset(TextInput1_11);
 Navigate(Screen1);
